    data: |
      SELECT + col1 / - col1 + + col1 + - col1 * - col0 * col2, 5 + - - col0 + + 85 AS col2 FROM tab2 (FORMAT parquet) WHERE ( NOT NULL NOT BETWEEN NULL AND - ( + col2 ) );
  - name: tab2

outputs:
  - name: q12084.out
    data: |
